  - uid: 1974
    components:
    - type: Transform
      pos: 0.4720105,25.55133
      parent: 1
    - type: Tag
      tags:
      - Document
      - Paper
      - NFPaperStampProtected
    - type: Paper
      stampState: paper_stamp-centcom
      stampedBy:
      - reapply: False
        stampType: RubberStamp
        stampedColor: '#006600FF'
        stampedName: stamp-component-stamped-name-centcom
      content: >-
        [head=1][bold]Operating Procedure[/bold][/head]


        These are general guidelines on how to act during various situations aboard the Tiran. They apply for large staffings of 4+ staff. It is highly recommended to have one engineer, three to four bridge staff. One bridge staff member should be the pilot, one the gunner, another a reloader and [italic]optionally[/italic] the last a Commander (preferably a Serzchant or Kommisar) to give orders and monitor the power and radar.


        The Tiran-class fleet capital ship is extremely slow and in thrust and rotation, hence requiring some sort of escort, as alone it is vulnerable.


        [italic]It is the Commander's responsibility that all staff, especially those essential, read the SoP and understand if any modifications to it are to be applied, what is to be followed or disregarded.[/italic]


        [head=2][color=green]Non-combat[/color][/head]


        Ensure the ship has all the following tasks done and equipment in possession:

        [bullet/]Two backup thruster flatpacks;

        [bullet/]Three backup superpacman flatpacks with fuel [italic]OR[/italic]

        [bullet/]Functioning solar panels providing charge to the SMES units, which are to have their output turned off to conserve power for emergencies. 40% of the panels need repairs.

        [bullet/]Extra wiring prepared to repair power in an emergency;

        [bullet/]A printed shuttle console board.


        [head=3][color=blue]Diplomacy and Civilian Work[/color][/head]


        If diplomats or civilians visit, they are to stay in the lower section of the ship, in the civilian area, up to the black airtight hatch doors. This is for their and our own safety, as the main hall has a turret which can pose a threat to diplomats and us. [bold]There is a USSP locked button with a grey outline in the lounge, near a trash cart; pressing it will open and hold all doors allowed for non-USSP members. Pressing it again will toggle holding, but wont close the doors[/bold]. This is to be done if civilians are expected to work there or if there are visiting diplomats. Any doors which are preferred closed require to be closing manually after hitting the button.


        [bold][color=#8B0000]Under NO circumstances are diplomats to attempt to approach the staff hallway beyond the airtight hatch, as the outside is guarded by turrets which WILL kill them. This sadly means medical is off limits for all diplomats or TSF/Rogue visitors, unless turrets are destroyed or walled off.[/bold][/color]


        [head=2][color=red]Active Combat and Emergencies[/color][/head]


        During active combat, all non essential personnel or visitors (civilians, diplomats) are to move to the bar and stay put, as during a frontal or side barrage, it is deemed the safest.


        Bridge personnel are to work together and communicate. The reloader is to work on reloading the charons, the Commander is to work with the gunner or monitor power situation and radar. The engineer is to prepare to restore power if such is needed (and monitor the power if the Commander cannot) and (or) seal all breaches with the RCD and metal foam grenade.


        [head=3][color=orange]Power loss[/color][/head]


        If the generators are destroyed, power from SMES will go in 2 minutes, and 2 minutes later, bridge will run dry. This means that you, at most, have 4 minutes to retreat to a safe place. The last light will go out in armory. If bridge power is lost during combat, move the shuttle console to a powered location and attempt to retreat.


        [bold]If the shuttle loses power fully, it is recommended that all staff moves to the bar and either barricades themselves, evacuates with EVA gear from the internals lockers or assists the engineer(-s) with repairs.[/bold] The engineers during this time are required to attempt to start power up at all costs, either using solar SMES (empty by default), the superpacmans set to max or any other means. If such is impossible, either await rescue or evacuate the ship. [bold]During this, the bridge should be evacuated as well[/bold], as it's a likely target after power is disabled. If power is restored and there exists a shuttle console, the ship is to immediately leave the combat area.


        [head=3][color=purple]Boarding[/color][/head]


        [bold]If the ship is boarded, all essential (pilot, commander)[/bold] and non-combat (civilian) [bold]personnel are to bunker down in [/bold]either engineering, the armory or [bold]the bridge.[/bold] The bridge has blast doors to prevent boarders quickly gaining access, and a turret guarding the exterior. Armory has turret inside, and engineering has secure doors. Dimplomats and TSF/Rogue visitors are to lock themselves in the botanical area (comes with a panic button, use it thrice to close and bolt the door shut) as turrets will execute them if they approach the staff areas.


        [bold]All combatants are to terminate the boarders, hiding will not be tolerated. Make Nova Cygni proud.[/bold]
